import React from 'react';
import { Box, Heading } from 'grommet';

const locationInput = ({ setLocationInput }) => {
  return (
    <Box>
      <Heading onClick={() => setLocationInput(true)}>Location Input</Heading>
    </Box>
  )
}

export default locationInput;
